- RULE-SET,geosite_@!cn_domains,✈️ 选择代理
- RULE-SET,geosite_cn,DIRECT
- RULE-SET,geoip_lan_ip,DIRECT,no-resolve
- RULE-SET,other_ssk_lan_ip,DIRECT,no-resolve
- RULE-SET,geoip_telegram_ip,Telegram,no-resolve
